void GpuServiceAsyncWaiter::EstablishGpuChannel(int32_t client_id, uint64_t client_tracing_id, bool is_gpu_host,
    ::mojo::ScopedMessagePipeHandle* out_channel_handle, ::gpu::GPUInfo* out_gpu_info, ::gpu::GpuFeatureInfo* out_gpu_feature_info,
    ::gpu::SharedImageCapabilities* out_shared_image_capabilities)
{
    base::RunLoop loop;
    proxy_->EstablishGpuChannel(std::move(client_id), std::move(client_tracing_id), std::move(is_gpu_host),
        base::BindOnce(
            [](base::RunLoop* loop, ::mojo::ScopedMessagePipeHandle* out_channel_handle, ::gpu::GPUInfo* out_gpu_info,
                ::gpu::GpuFeatureInfo* out_gpu_feature_info, ::gpu::SharedImageCapabilities* out_shared_image_capabilities,
                ::mojo::ScopedMessagePipeHandle channel_handle, const ::gpu::GPUInfo& gpu_info, const ::gpu::GpuFeatureInfo& gpu_feature_info,
                const ::gpu::SharedImageCapabilities& shared_image_capabilities) {
                *out_channel_handle = std::move(channel_handle);
                *out_gpu_info = std::move(gpu_info);
                *out_gpu_feature_info = std::move(gpu_feature_info);
                *out_shared_image_capabilities = std::move(shared_image_capabilities);
                loop->Quit();
            },
            &loop, out_channel_handle, out_gpu_info, out_gpu_feature_info, out_shared_image_capabilities));
    loop.Run();
}

